import React from "react";
import cartContext from "./CartContext";

const CartContextProvider = (props) => {
  const cartContext = {
    items: [],
    totalAmount: 0,
    AddItemHandler: "",
    removeItemHandler: "",
  };

  return <cartContext.Provider>{props.children}</cartContext.Provider>;
};

export default CartContextProvider;
